INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (10201, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2030/01/01 14:59:59", -285.0, 5.18, -6.0, 61, 133701, 3, "2025/01/31 12:00:00", 1020101, 7, "ラビリスタ", 101);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (10201, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2030/01/01 14:59:59", -285.0, 8.77, -2.0, 61, 133901, 1, "2025/01/31 12:00:00", 1020102, 2, "クリスティーナ", 201);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (10201, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2030/01/01 14:59:59", -285.0, 15.5, 0.0, 61, 133801, 6, "2025/01/31 12:00:00", 1020103, 1, "ネネカ", 301);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (10202, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2030/01/01 14:59:59", -285.0, 9.061, 0.0, 61, 134301, 2, "2025/02/28 12:00:00", 1020201, 5, "ランファ", 101);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (10202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2030/01/01 14:59:59", -285.0, 7.699, 0.0, 61, 134401, 1, "2025/02/28 12:00:00", 1020202, 2, "チカ", 201);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (10203, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2030/01/01 14:59:59", -285.0, 8.595, 0.0, 61, 134601, 1, "2025/03/31 12:00:00", 1020301, 2, "アオイ", 101);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (10203, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2030/01/01 14:59:59", -285.0, 7.758, 0.0, 61, 134501, 1, "2025/03/31 12:00:00", 1020302, 2, "クローチェ", 201);
